function novaOpenEyes(speed, white, animation) {
  if (!white) {
    g.drawImage(novaEyesStage4(), -10, -10, {
      scale: 2.2
    });
    setTimeout(function() {
      g.drawImage(novaEyesStage3(), -10, -10, {
        scale: 2.2
      });
    }, speed * 2);
    setTimeout(function() {
      g.drawImage(novaEyesStage2(), -10, -10, {
        scale: 2.2
      });
    }, speed * 3);
    setTimeout(function() {
      g.drawImage(novaEyesStage1(), -10, -10, {
        scale: 2.2
      });
    }, speed * 4);
    if (animation) {
      setTimeout(function() {
        g.drawImage(novaEyesStage0(), -10, -10, {
          scale: 2.2
        });
      }, speed * 5);
    }
  } else {

    g.drawImage(novaEyesStage4(), -10, -10, {
      scale: 2.2
    });
    setTimeout(function() {
      g.drawImage(novaEyesWhiteStage0(), -10, -10, {
        scale: 2.2
      });
      timedraw(true);
      g.drawImage(novaEyesTransStage3(), -10, -10, {
        scale: 2.2
      });
    }, speed * 2);
    setTimeout(function() {
      g.drawImage(novaEyesWhiteStage0(), -10, -10, {
        scale: 2.2
      });
      timedraw(true);
      g.drawImage(novaEyesTransStage2(), -10, -10, {
        scale: 2.2
      });
    }, speed * 3);
    setTimeout(function() {
      g.drawImage(novaEyesWhiteStage0(), -10, -10, {
        scale: 2.2
      });
      timedraw(true);
      g.drawImage(novaEyesTransStage1(), -10, -10, {
        scale: 2.2
      });
      open = true;
    }, speed * 4);
    if (animation) {
      setTimeout(function() {
        g.drawImage(novaEyesWhiteStage0(), -10, -10, {
          scale: 2.2
        });
        open = true;
      }, speed * 5);
    }
  }
}

function novaCloseEyes(speed, white, animation) {
  if (!white) { // for other
    if (animation) {
      g.drawImage(novaEyesStage0(), -10, -10, {
        scale: 2.2
      });
    }
    setTimeout(function() {
      g.drawImage(novaEyesStage1(), -10, -10, {
        scale: 2.2
      });
    }, speed * 2);
    setTimeout(function() {
      g.drawImage(novaEyesStage2(), -10, -10, {
        scale: 2.2
      });
    }, speed * 3);
    setTimeout(function() {
      g.drawImage(novaEyesStage3(), -10, -10, {
        scale: 2.2
      });
    }, speed * 4);
    setTimeout(function() {
      g.drawImage(novaEyesStage4(), -10, -10, {
        scale: 2.2
      });
    }, speed * 5);
  } else { // for time

    if (animation) {
      timedraw(true);
      g.drawImage(novaEyesWhiteStage0(), -10, -10, {
        scale: 2.2
      });
    }
    setTimeout(function() {
      timedraw(true);
      g.drawImage(novaEyesTransStage1(), -10, -10, {
        scale: 2.2
      });
    }, speed * 2);
    setTimeout(function() {
      timedraw(true);
      g.drawImage(novaEyesTransStage2(), -10, -10, {
        scale: 2.2
      });
    }, speed * 3);
    setTimeout(function() {
      timedraw(true);
      g.drawImage(novaEyesTransStage3(), -10, -10, {
        scale: 2.2
      });
    }, speed * 4);
    setTimeout(function() {
      g.drawImage(novaEyesStage4(), -10, -10, {
        scale: 2.2
      });
    }, speed * 5);
    open = false;
  }
}

function timedraw(animation) {
  if (open && timemode || animation) {
    g.setFont("6x8", 4);
    g.setColor("#00F");
    var d = new Date();
    var h = d.getHours(),
      m = d.getMinutes();
    g.drawImage(novaEyesWhiteStage0(), -10, -10, {
      scale: 2.2
    });
    g.drawImage(novaEyesTransStage1(), -10, -10, {
      scale: 2.2
    });
    // Check if single digit
    var hourDigits = h.toString();
    if (hourDigits.length === 1) { // if hour digits only one, render in middle
      g.drawString(h, 50, 66);
    } else {
      g.drawString(h, 38, 66);
    }
    var minutes = m.toString();
    if (minutes.length === 1) { // same for mins
      g.drawString(m, 107, 66);
    } else {
      g.drawString(m, 94, 66);
    }
  }
}

function main() {
  Bangle.on("lock", function(lock) {
    g.drawImage(novaTopRedraw(), -10, novaYPos, {
      scale: 2.2
    });
    if (lock) {
      novaCloseEyes(200, true, false);
      setTimeout(function() {
        novaOpenEyes(100, false, false);
        timemode = false;
      }, 1200);
    }else{
      novaCloseEyes(100, false, false);
      setTimeout(function() {
        timemode = true;
        novaOpenEyes(200, true, false);
      }, 600);
    }
  });
}


g.setFont("6x8", 4);
g.setColor("#FFF");
var open = false;
var timemode = true;
var novaYPos = -7;
Bangle.setUI("clock");
g.clear();
Bangle.loadWidgets();
Bangle.drawWidgets();
g.drawImage(nova(), -10, -10, {
  scale: 2.2
});

g.drawImage(star(), 5, -5, {scale:0.8});
g.drawImage(star(), -10, 120, {scale:0.8});
g.drawImage(star(), 120, -5, {scale:0.8});



setInterval(function() {
  timedraw();
  g.drawImage(novaTopRedraw(), -10, novaYPos, {
    scale: 2.2
  });
}, 1000);

novaOpenEyes(300, true, false);
main();
